import Login from './pages/login/Login';
import Register from './pages/register/Register';
import { Routes, Route } from 'react-router-dom';
function App() {
  const router = createBrowserRoute;
  return (
    <Routes>
      <div className="app">
        <Route to="/register" Register />
      </div>
    </Routes>
  );
}

export default App;
